import React from "react";
import Poster from "./Poster";
import Best from "./Best";
import Success from "./Success";
import Specialservice from "./Specialservice";
import Havedone from "./Havedone";
// import Workers from "./Workers";

const Body = () => {
  return (
    <>
    <Poster />
    <Best />
    <Success/>
    <Specialservice/>
    <Havedone/>
    {/* <Workers/> */}
    </>
  )
}


export default Body;
